import React, { memo } from "react";
import AdminList from "./AdminList";
import Background from "../components/Background";
import BackButton from "../components/BackButton";
import { View,WebView,StyleSheet } from "react-native";
import { Header } from 'react-native-elements';
import RefreshButton from '../components/RefreshButton';
import  Adminresolvedview from './Adminresolvedview';
export const AdminCharts = ({navigation}) => (
   <Background>
   <Header
  backgroundColor='#F6820D'
  rightComponent={<RefreshButton/>}
  leftComponent={<BackButton goBack={() => navigation.navigate("AdminDashboard")} />}
  centerComponent={{text:'STATISTICS'}}/>   
  <View style = {styles.container}>
     <WebView
        source={{
          uri: 'https://sites.google.com/view/maintanancechart/home'
        }}
        style={{ marginTop: 20 }}
      />
      </View>
    </Background>
  );
export default memo(AdminCharts);

const styles = StyleSheet.create({
  container: {
     height: 350,
     w
  }
})
